import React, { Component } from 'react'
import Table from './Table'
import Form from './Form'
import avgTop30Contacted from './Average30Contacted'

class App extends Component {
    state = {
        characters: [],
        averageListing : {},
        distributions: [],
        top5PerMonth: {},
        Averge30TopContacted: ""
    };

    removeCharacter = (index) => {
        const { characters } = this.state

        this.setState({
            characters: characters.filter((character, i) => {
                return i !== index
            }),
        })
    }

    handleSubmit = (character) => {
        this.setState({ characters: [...this.state.characters, character] })
    }

    componentDidMount() {
        fetch('http://localhost:8080/Averge30TopContacted')
        .then(res => res.json())
        .then((data) => {
          this.setState({ Averge30TopContacted: data })
        })
        .catch(console.log)
    }

    render() {
        const { characters } = this.state

        return (
            <div className="container">
                <Table charactersData={characters} removeCharacter={this.removeCharacter} />
                <Form handleSubmit={this.handleSubmit}/>
                <Averge30TopContacted />
            </div>
        )
    }
}

